SnF$_{2}$ is found in three structures: \begin{itemize} \item \href{current_web_home_dir/A2B_mC48_15_4f_2f-001}{monoclinic $\alpha$-SnF$_{2}$}, the ground state \item \href{current_web_home_dir/A2B_oP12_19_2a_a-002}{orthorhombic $\beta$-SnF$_{2}$} (this structure), formed from $\gamma$-SnF$_{2}$ on cooling below $67^{\circ}$C, and \item tetragonal $\gamma$-SnF$_{2}$, produced by heating $\alpha$-SnF$_{2}$ above $180^{\circ}$C, forming in the \href{current_web_home_dir/A2B_oP24_61_2c_c-002}{tellurite ($\beta$-TeO$_{2}$) structure}. \end{itemize} ~ \vspace{-.25in} 
 Data for $\beta$-SnF$_{2}$ was taken at room temperature. 
 \href{current_web_home_dir/A2B_oP12_19_2a_a-001}{Low-temperature Naumannite (AgO$_{2}$ II)} and \href{current_web_home_dir/A2B_oP12_19_2a_a-002}{$\beta$-SnF$_{2}$} have the same AFLOW prototype label, A2B\_oP12\_19\_2a\_a. They are generated by the same symmetry operations with different sets of parameters ({\tt --params}) specified in their corresponding CIF files.
